// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
    dealer设置白名单时：
        创建新id时调用createID
        TODO:记录发起历史
        记录dealer id当前对应的player index----dealerToPlayer
        记录index对应的最大玩家数量----playerToAmount
        mint 1155 给玩家

 */
contract Player is ERC1155, Ownable {
    using Strings for uint256;

    address public dealer;
    string public name;
    string public symbol;

    uint256 public index = 0;

    mapping(uint256 => uint256) public dealerToPlayer;
    mapping(uint256 => uint256) public playerToDealer;
    mapping(uint256 => uint256) public playerToAmount;
    mapping(uint256 => uint256) public playerType;
    mapping(uint256 => uint256) public idToAmount;

    struct PropertyParams {
        string name;
        string symbol;
        string baseURI;
    }

    constructor(
        string memory name_,
        string memory symbol_,
        string memory tokenURI_
    ) ERC1155(tokenURI_) {
        name = name_;
        symbol = symbol_;
    }

    function createID(uint256 id, uint256 supply) external onlyDealer {
        index = index + 1;
        dealerToPlayer[id] = index;
        playerToDealer[index] = id;
        playerToAmount[index] = supply;
    }

    function mint(address[] memory users, uint256 id) external onlyDealer {
        require(idToAmount[index] + users.length <= playerToAmount[index], "Supply!");
        idToAmount[id] = idToAmount[id] + users.length;
        for (uint256 i = 0; i < users.length; i++) {
            require(balanceOf(users[i], id) == 0, "you have been player");
            _mint(users[i], id, 1, bytes(''));
        }
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) public virtual override {
        require(
            false,
            "ERC1155: can not transfer"
        );
        _safeTransferFrom(from, to, id, amount, data);
    }

    /**
     * @dev See {IERC1155-safeBatchTransferFrom}.
     */
    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) public virtual override {
        require(
            false,
            "ERC1155: can not transfer"
        );
        _safeBatchTransferFrom(from, to, ids, amounts, data);
    }

    function setDealer(address dealer_) external onlyOwner {
        dealer = dealer_;
    }

    function totalSupply(uint256 id) public view returns (uint256) {
        return playerToAmount[id];
    }

    function totalSupplyBatch(uint256[] calldata ids) public view returns (uint256[] memory) {
        uint256[] memory supply = new uint256[](ids.length);

        for (uint i = 0; i < ids.length; i++) {
            supply[i] = playerToAmount[ids[i]];
        }

        return supply;
    }

    function uri(uint256 id) public view override returns (string memory) {
        string memory baseURI = super.uri(id);
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, id.toString())) : "";
    }

    function setBaseURI(string memory baseUri) external onlyOwner {
        _setURI(baseUri);
        emit SetBaseUri(baseUri);
    }

    modifier onlyDealer() {
        require(dealer == msg.sender, "not Dealer");
        _;
    }

    event Init(PropertyParams params);

    event CreateAttribute(string attribute);

    event CreateID(string attribute, uint256[] ids, uint256[] supply);

    event SetBaseUri(string baseUri);

    event SetWhitelist(address[] whitelist);
}
